var Gamehub = {

  

 
  
  Settings: {
    gameName: "",
    splashScreen: "data:image/png;base64,",
    rotationLockScreen: {
      landscape: "",
      portrait: ""
    },
    resourceHost: [
      window.location.hostname + ":9500",
      window.location.hostname + ":9500",
      window.location.hostname + ":9500",
      window.location.hostname + ":9500",
    ],
    resourcePath: function(path) {
      var filename = path.split("/").pop();
      if (path.substr(0, 2) == "./") {
        path = path.substr(2);
      }
      if (path[0] != "/") {
        var uri_parts = window.location.pathname.split("/");
        uri_parts.pop();
        path = uri_parts.join("/") + "/" + path;
      }
      var p = Math.floor(filename.length / 2);
      var str = filename[p];
      var code = str.charCodeAt(0);
      if (typeof code != typeof 100) {
        code = parseInt(code);
      }
      var i = code % this.resourceHost.length;
      return "http://" + this.resourceHost[i] + path;
    }
  }
}